import React from "react";
import Button from '@material-ui/core/Button';
import DeleteIcon from '@material-ui/icons/Delete';

const Notes = (prop) => {
    const del=()=>{
        return(
            prop.delBtn(prop.i)
        )
    }
    return (
        <>
                <div class=" d-inline-block">
                    <form className="text-center  p-3 mt-5 ">
                        <div class="card shadow-lg " style={{ width: "15rem" }}>
                            <h4 className="pt-2">{prop.va}</h4>
                            <div class="card-body">
                                <p>{prop.con}</p>
                                <Button onClick={del} className="bton1 shadow-lg">
                                    <DeleteIcon/>
                                </Button>
                            </div>
                        </div>
                    </form>
                </div>
               

            


        </>
    )
}
export default Notes;
